window.bookSummaryJSON = "<p>After surviving countless perils and dangers, including an examination by the Blood Council, Fred is preparing to take on his most important adventure to date: marrying Krystal. That is, if he can get everything handled in time. Visiting Boarback, hiring new staff, clearing out his schedule for a honeymoon; there’s no shortage of tasks to check off before the big day arrives. </p> <p>But not everyone views the occasion in such a happy light. With new dangers looming, old debts raised, and grudges rekindled, it’ll take everything Fred has to finally make it down the aisle. </p> <p>Performed by Christopher Walker, Carolyn Kashner, Nora Achrati, Bradley Smith, Eva Wilhelm, Jessica Lauren Ball, Karen Novack, Yasmin Tuazon, Christopher Graybill, Shanta Parasuraman, Nanette Savard, Nazia Chaudhry, Danny Gavigan, Zeke Alton, Ken Jackson, Alejandro Ruiz, Eric Messner, Marni Penning, Tia Shearer, Chris Stinson, Elizabeth Jernigan, Richard Rohan, Scott McCormick, Terence Aselford, David Zitney, and Colleen Delany.</p>"; 
